$(function(){

  //나중에 바꿀 것: 스크롤탑 0일때만 투명배경 아닐때는 흰배경
  //스크롤 업/다운 따라서 메뉴 온오프

  $(window).scroll(function(){
    let p=$(this).scrollTop()
    if(p===0){
      $('.header').addClass('top')
    } else{$('.header').removeClass('top')}
  })




  $('.gnb ul>li').hover(function(){
    $(this).children('.gnb_hover').stop().fadeIn(300)
    $('.header').removeClass('top')
    },function(){
      $(this).children('.gnb_hover').stop().fadeOut(300)
    })



})////jquery_END






 

// swiper
new Swiper('.vm_slider', {
    loop: true,

    autoplay: {
      delay: 5000,
      disableOnInteraction: false,
    },
  
    navigation: {
      nextEl: '.swiper-button-next',
      prevEl: '.swiper-button-prev',
    },
  
    pagination: {
      el: ".swiper-pagination",
      type: "progressbar",
    },
  });

//data-swiper-slide-index  이게 슬라이드 index임에 참고<< index는 자꾸 바뀌니까!!! 근데 어떻게 해야하지



new Swiper(".new_tab", {
  slidesPerView: "auto",
  centeredSlides: true,
  slideToClickedSlide: true,
  touchRatio: 1,
  
  observer: true,
  observeParents: true,

  speed: 800,
  // loop: true,
  rewind: true,
  
  
  autoplay: {
    delay: 2500,
    disableOnInteraction: false,
    pauseOnMouseEnter:true,
  }, 

  navigation: {
    nextEl: ".swiper-button-next",
    prevEl: ".swiper-button-prev",
  },
  
  pagination: {
    el: ".swiper-pagination",
    clickable: true,
  },
  
});









/* rank */
const rankList1 = document.querySelectorAll('.rank_list1 li')
const rankList2 = document.querySelectorAll('.rank_list2 li')

//rankslider1
const rankSlider1 = new Swiper(".rank_slider1", {
    slidesPerView: 'auto',
    slideToClickedSlide: true,
    loop: true,
    loopAdditionalSlides: 1,

    autoplay: {
      delay: 3000,
      disableOnInteraction: false,
    }, 

    on: {
      activeIndexChange: function(){
        rankList1.forEach((rank,i)=>{
          rank.classList.remove('on')
          if(i===this.realIndex){
            rank.classList.add('on')            
          } //if

        })//forEach
      }//activeIndex
    }//on    
  });

rankList1.forEach((rank,i)=>{
  rank.addEventListener('click',function(){
    rankSlider1.slideToLoop(i,300,true)
  })
})


//rankslider2
const rankSlider2 = new Swiper(".rank_slider2", {
  slidesPerView: 'auto',
  slideToClickedSlide: true,
  loop: true,
  loopAdditionalSlides: 1,

  autoplay: {
    delay: 3000,
    disableOnInteraction: false,
  }, 

  on: {
    activeIndexChange: function(){
      rankList2.forEach((rank,i)=>{
        rank.classList.remove('on')
        if(i===this.realIndex){
          rank.classList.add('on')            
        } //if

      })//forEach
    }//activeIndex
  }//on    
});

rankList2.forEach((rank,i)=>{
  rank.addEventListener('click',function(){
    rankSlider2.slideToLoop(i,300,true)
  })
})
